import { Layout, Typography } from "antd";
import './Homepage.css'

function HomePage(){
    return(
        <Layout>
        
            <div className="homepage">
                <Typography.Title level={4}>Home</Typography.Title>
            </div>
        </Layout>
        
    )
}
export default HomePage;
